import Navbar from "../Components/Navbar"
import Forms from '../Components/Forms';
import Head from "next/head";

const Layout = (props) => (
<div>
<Head>
<title>myCountry Info</title>
</Head>
<Navbar />
<Forms />
<div>
{props.children}
</div>
</div>



)


export default Layout;
